'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe term bubble , as I use it, refers not only to the economic bubble in which the valuation of some tech start-ups went crazy but also to the mindset of the people working inside technology companies, the true believers and Kool-Aid drinkers, the people who live inside their own filter bubble, brimming with self-confidence and self-regard, impervious to criticism, immunized against reality, unaware of how ridiculous they appear to the outside world.\n\nApril 28, 2017\n\u001c7\n\u0011\n\u0011\n\n\nChapter 1: Beached White Male\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI think they just want to hire younger people,” Abby says. “They can take your salary and hire five kids right out of college.” “Sure.” I’m not angry. I’m just dumbfounded. “I get it.” From outside comes the roar of a lawnmower. I glance out the window and see that the guys who mow our lawn have arrived in their truck. I make a mental note that this is one small luxury that we now will have to live without, because surely an unemployed man cannot pay someone else to mow his lawn. I’m not even finished getting fired yet and I’m already thinking about ways to save money. Should we get rid of cable TV? Will we stop going out to dinner? Can we still go to Austria?\n\nApril 28, 2017\n\u001c21\n\u0011\n\u0011\n\n\nChapter 5: HubSpeak\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c72\n\u0011\n\u0011\n\n\nChapter 7: We Need to Make the Blog a Lot More Dumberer\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt turns out that Cranium rarely speaks to any of the people in the sixty-person marketing department. He spends four days a week in the office. On Friday he works from home. He talks to Wingman and apparently to a few other people who are his direct reports, but that seems to be it. He never takes the gang to lunch, never pulls people aside to ask how they’re doing, never sets up a one-on-one just to check in or give you feedback. Instead, he conducts anonymous online surveys. Constantly. Are you happy? How happy are you? On a scale of one to ten, with ten being the happiest day in your entire life, how happy are you? What if anything could make you happier? How could HubSpot be better? “More surveys,” I suggest once.\n\nApril 28, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSince Cranium is not in contact with me, I am left to get direction from Wingman. But Wingman is equally tuned out. One day he sets a meeting with me to ask how things are going. I tell him I’m not sure what they want me to do. He says I should just write articles for the blog. “Just write about anything you want,” he says.\n\nApril 28, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c89\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c90\n\u0011\n\u0011\n\n\nChapter 8: The Bozo Explosion\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApple CEO Steve Jobs used to talk about a phenomenon called a “bozo explosion,” by which a company’s mediocre early hires rise up through the ranks and end up running departments. The bozos now must hire other people, and of course they prefer to hire bozos. As Guy Kawasaki, who worked with Jobs at Apple, puts it: “B players hire C players, so they can feel superior to them, and C players hire D players.” That’s the bozo explosion, and that’s what I believe has happened at HubSpot in the course of the last seven years. “How weird are you, on a scale from one to ten?” is an actual question that HubSpot’s twenty-something managers ask job candidates during interviews\n\nApril 28, 2017\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“HubSpot was the first software company I worked for, and it was extremely eye-opening,” says a salesperson who joined the company during its early days and has since worked for other early-stage tech companies, which were equally clueless and out of control. “People in these companies live day-to-day. They don’t know how to run a sales team. They don’t have a sales process. They don’t even know what the product itself is going to be. The product itself keeps changing. It’s mind-boggling, the amount of time and money that gets wasted.”\n\nApril 28, 2017\n\u001c104\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1dpfaLh0CbCMM00mrrDGxo44yW98IG70M0GOgzqo","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1h-pME2_Eszz95xGTDiOXuOijPD2zMcatNTAirVY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opVa