alse,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3530,"ei":3545,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3546,"ei":3563,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3564,"ei":3579,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3580,"ei":3598,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3599,"ei":4141,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4142,"ei":4157,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4158,"ei":4164,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU"  nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU"  nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU">DOCS_modelChunk = [{"ty":"is","ibi":4165,"s":"\n\n\nChapter 10: Life in the Boiler Room\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c118\n\u0011\n\u0011\n\n\nChapter 11: OMG the Halloween Party!!!\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c125\n\u0011\n\u0011\n\n\nChapter 12: The New Work: Employees as Widgets\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother thing I’m learning in my new job is that while people still refer to this business as “the tech industry,” in truth it is no longer really about technology at all. “You don’t get rewarded for creating great technology, not anymore,” says a friend of mine who has worked in tech since the 1980s, a former investment banker who now advises start-ups. “It’s all about the business model. The market pays you to have a company that scales quickly. It’s all about getting big fast. Don’t be profitable, just get big.”\n\nApril 28, 2017\n\u001c130\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c137\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShe cries in her car. She has panic attacks about going to work. She feels humiliated. She has no idea what she did wrong or why she’s being let go. Paige, thirty-five, gets tossed on a Friday morning, a few weeks shy of her one-year anniversary, when her first batch of options would vest. Ironically, Zack fires her during Fearless Friday, our feminist empowerment team-building exercise. While a group of women just out of college are downstairs in a conference room making paintings on the floor, Paige, a former Wall Street analyst, is up on the second floor being sacked for an alleged lack of productivity. Zack tells her to clean out her desk and leave. She’s done. Right now. She gets no severance pay. She walks out, fighting back tears, and texts me from her car in the parking garage: You won’t believe this. I just got fired. When I call her, she’s crying. A colleague in the marketing department tells me that back in 2011, before my time, another thirty-something woman was fired after only four months on the job. She was pregnant with twins. “The company can do whatever it wants,” one manager tells me, and my jaw drops.\n\nApril 28, 2017\n\u001c137\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis is the New Work, but really it is just a new twist on an old story, the one about labor being exploited by capital.\n\nApril 28, 2017\n\u001c138\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother way to drive down labor costs is to deny people employee status in the first place. Uber, the ride-sharing company, saves money by categorizing drivers as independent contractors rather than employees. Uber insists drivers prefer this because they enjoy more freedom. Uber and others in the “share economy” are creating a new form of serfdom, an underclass of quasi-employees who receive low pay and no benefits. As former secretary of labor Robert Reich put it in a June 2015 Facebook post: “The ‘share economy’ is bunk; it’s becoming a ‘share the scraps’ economy.”\n\nApril 28, 2017\n\u001c138\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cApril 28, 2017\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe employees are paid in part with stock options. The strike price on the options is calculated based on the valuation of the company at the time the options are granted. If you joined the company late, you probably have a high strike price. If the company goes public at a lower valuation—if it suffers a “cramdown,” as it’s called—then your options might be underwater.\n\nApril 28, 2017\n\u001c144\n\u0011\n\u0011\n\n\nChapter 13: The Ron Burgundy of Tech\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe’re screwed , I keep thinking. We’re totally, absolutely screwed. Not because the ExactTarget product is better than ours, because who even knows, and who even cares? Having the best product has nothing to do with who wins. What matters is who can put on a great show, who can create the biggest spectacle, who can look huge and unstoppable and invincible, and who is the best at bluster and hype\n\nApril 28, 2017\n\u001c149\n\u0011\n\u0011\n\n\nChapter 15: Grandpa Buzz\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut I’ve also tapped into a huge well of anger that I didn’t know existed. Apparently, a lot of people have been pushed aside after reaching a\n\nApril 28, 2017\n\u001c165\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccertain age, especially in the tech industry. The things Halligan said out loud are exactly what those people suspect their bosses were thinking about them when they shoved them out the door. Officially nobody ever gets fired because of age. Officially, their position no longer exists, or the department is changing priorities. But everyone knows the truth. They’re old, and they get paid too much. As my editor at Newsweek told me, “They can take your salary and hire five kids right out of college.” Now here is some asshole tech CEO who has just blurted that out, in an interview. On Facebook, Spinner chimes in. She writes an angry comment under my Facebook post telling me I am not a team player: “We’re all supposed to be solving for EV,” she writes. EV means enterprise value, and “solving for EV” means we’re all supposed to be doing whatever we can to pump up the value of the company. Then Cranium jumps into the fray. Instead of apologizing for Halligan he doubles down and defends the remarks. “I give Brian credit for being transparent and upfront,” Cranium writes. “A lot of CEOs are hard to read and borderline deceptive. With Brian you know what he is thinking and I think that is awesome.”\n\nApril 28, 2017\n\u001c165\n\u0011\n\u0011"},{"ty":"te","id":"i.11","spi":4212},{"ty":"te","id":"i.12","spi":4288},{"ty":"te","id":"i.13","spi":4372},{"ty":"te","id":"i.14","spi":4929},{"ty":"te","id":"i.15","spi":4964},{"ty":"te","id":"i.16","spi":6139},{"ty":"te","id":"i.17","spi":6296},{"ty":"te","id":"i.18","spi":6907},{"ty":"te","id":"i.19","spi":6942},{"ty":"te","id