_it_i":false,"ts_fs_i":false,"ts_ff_i":false,"ts_fgc":"#000000","ts_fgc_i":true,"ts_it":true,"ts_bd_i":false,"ts_va_i":true,"ts_fs":16.0,"ts_ff":"Droid Serif","ts_bd":false}},{"ty":"as","st":"text","si":7855,"ei":7998,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7999,"ei":8014,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8034,"ei":9242,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":9243,"ei":9258,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU"  nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU"  nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU">DOCS_modelChunk = [{"ty":"is","ibi":9266,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA gaffe is when a politician tells the trut\n\nApril 28, 2017\n\u001c167\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of the maddening things about discrimination of any kind is that it is often difficult, if not impossible, to prove that it’s taking place. The bias is often subtle, or even subconscious. People at HubSpot rarely talk about age bias, and when they do, they’re not talking about older workers being treated poorly. They’re talking about how unfair it is that people in their early twenties are not given enough responsibility, just because they’re young. But at work people make frequent references to my age. They speak euphemistically about my experience , wink-wink. I am asked whether I know how to use Facebook.\n\nApril 28, 2017\n\u001c170\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cStart-up people talk a lot about the importance of “culture fit.” Wingman brought this up during our very first meeting, over lunch at the Thai restaurant, where he told me that he tries to hire people that he would like to meet for beers after work. In tech, the concept of culture fit is presented as a good thing. Unfortunately what culture fit often means is that young white guys like to hire other young white guys, and what you end up with is an astonishing lack of diversity. HubSpot’s problem isn’t just about age. The company also has issues regarding gender and ethnicity. There are plenty of female employees, but the company’s top ranks are stacked with men, almost all of them white. The sixteen-member management team includes two women. Of the eight directors, two are women, and aside from Dharmesh, everyone is white. Across the ranks of ordinary employees, as far as I can see there are zero black people. The first time I go to an all-hands company meeting I’m taken aback: It’s an ocean of white people, all of them young. It’s not just that everyone is white, but that they’re all the same kind of white. Klan rallies probably comprise a broader swath of the Caucasian population\n\nApril 29, 2017\n\u001c172\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe tech industry’s ageism is blatant and unapologetic. It’s wrapped up in the mythology that has sprung up around start-ups. Almost by definition these companies are founded and run by young people. Young people are the ones who change the world. They’re filled with passion. They have new ideas. Venture capitalists openly admit they prefer to invest in twenty-something founders. “The cut-off in investors’ heads is thirty-two,” Paul Graham, who runs an incubator called\n\nApril 29, 2017\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJohn Doerr, a legendary venture capitalist and partner at Kleiner Perkins, once said he liked to invest in “white male nerds who have dropped out of Harvard or Stanford and they have absolutely no social life. When I see that pattern coming in, it [is] very easy to decide to invest\n\nApril 29, 2017\n\u001c174\n\u0011\n\u0011\n\n\nChapter 23: Escape Velocity\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cManagement hopes to raise $100 million in the IPO. The prospectus contains a warning: “We have a history of losses and may not achieve profitability in the future.” Note this does not say it will take a while to achieve profitability, or that profits will one day arrive but the company cannot predict when this will happen. Rather, the prospectus says the company might never become profitable. Sure, this is partly just a way to be conservative. Companies always exaggerate the risks to their business so that they can’t be accused later of misleading investors or overpromising. So what are you getting if you buy this stock? You’re not really investing; you’re speculating. You’re hoping that whatever price you pay, someday someone else will be willing to pay more for it. No doubt there are people who will buy HubSpot shares without ever reading the prospectus or looking at the income statement or balance sheet. They’re just buying a story. They’re also hoping that the IPO will deliver a little “pop,” meaning the stock will go up on its first day of trading, giving them an instant profit\n\nApril 29, 2017\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat’s most remarkable is that HubSpot pulled this off even though the company had come within a hair’s breadth of running out of money. Apparently this happens more often than I realized. “It’s called ‘Go public or go broke,’ and it’s not at all uncommon,” says Trip, a former investment banker and venture capitalist. “The one thing people do not appreciate is that these companies are incredibly fragile. There is so much less to them than people believe\n\nApril 29, 2017\n\u001c244\n\u0011\n\u0011"},{"ty":"te","id":"i.23","spi":9275},{"ty":"te","id":"i.24","spi":9355},{"ty":"te","id":"i.25","spi":10011},{"ty":"te","id":"i.26","spi":11249},{"ty":"te","id":"i.27","spi":11759},{"ty":"te","id":"i.28","spi":12108},{"ty":"te","id":"i.29","spi":13244},{"ty":"as","st":"paragraph","si":9266,"ei":9266,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":9267,"ei":9267,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":9268,"ei":9268,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":9270,"ei":9270,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":9272,"ei":9272,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":9274,"ei":9274,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},