ZAnP1M8znkKjUU"  nonce="7kf1+PJjXTWC2ZAnP1M8znkKjUU">DOCS_modelChunk = [{"ty":"is","ibi":13729,"s":"\n\n\nChapter 24: If I Only Had a HEART\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTrotsky says there is another part to the performance review. For every review, he is required to get feedback about an employee from his or her peers. Oh shit. Here it comes. I figure he’s going to open his laptop and read some quotes about me that are going to go straight through my rib cage and into my heart. Maybe they really did come from a peer, or maybe he will have just made them up. Either way, this is going to suck. I steel myself. “So I asked two people,” he says. “I asked two people who work with you to give me comments about you. I sent them email, and they didn’t respond. I emailed them again, and asked them a few times, but they never responded.” “Oh,” I say. “Do you think maybe they just forgot to do it?” He winces, and shakes his head. “I don’t think so,” he says. He waits. I wait. I’m not quite sure what to say. “So I got no feedback at all about you. What do you think that says about you?”\n\nApril 29, 2017\n\u001c250\n\u0011\n\u0011"}
